import { useState } from 'react';
import LoginPage from './LoginPage';

function SignupPage() {

    // const [details, setDetails] = useState({firstname:"", lastname:"", address:"", status:0})

    // const submitHandler = e => {
    //     e.preventDefault();

    //     Signup(details)
    // }

    return(
        <form>
            <div className="form-inner">
                <h2>Sign Up</h2>
                <div className="login-form-group">
                    <label htmlFor="first-name">First Name:</label>
                    <input type="text" name="first-name" id="first-name" />
                </div>
                <div className="login-form-group">
                    <label htmlFor="last-name">Last Name:</label>
                    <input type="text" name="last-name" id="last-name" />
                </div>
                <div className="login-form-group">
                    <label htmlFor="address">Address:</label>
                    <input type="text" name="address" id="address" />
                </div>
                <div className="login-form-group">
                    <label htmlFor="status">I am a:</label>
                    <div>
                        <input type="checkbox" id="scales" name="scales" />
                        <label for="scales">Driver</label>
                    </div>

                    <div>
                        <input type="checkbox" id="horns" name="horns" />
                        <label for="horns">Passenger</label>
                    </div>
                </div>
                <div className="login-form-group">
                    <input type="submit" className = "google-login-button" value="Sign up with google" />
                </div>
            </div>
        </form>
    )
}

export default SignupPage
